import React from 'react';
import './App.css';


const App = () => {
  return (
    <div classname='app-wrapper'>
      <header classname='header'>
        <img src='https://e7.pngegg.com/pngimages/981/512/png-clipart-avengers-logo-captain-america-thor-hulk-logo-captain-america-marvel-avengers-assemble-avengers.png'></img>
      </header>
      <nav classname='nav'>
        <div classname='content'>
          Profile
        </div>
      </nav>
      <div>
        Main content
      </div>
    </div>);
}


export default App;
